import React from 'react';
import styled from 'styled-components';
import logo from '../icons/logo.svg';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams,
    useRouteMatch
} from "react-router-dom";

const LeftNav = styled.div`
    display: flex;
    position: relative;

    img {
        position: absolute;
        top: -1.5rem;
        left: -1.5rem;
        height: 8rem;
    }   

    ul {
    margin-left: 8rem;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
    list-style: none;
    }

    li button {
        margin: 0 1rem;
        display: inline-block;
        padding: .5rem 1rem;
        color: ${props => props.theme.colors.darkRed};
        border-radius : 2rem;
        border: none;
        text-align: center;
        text-decoration: none;
        font-size: 1.6rem;
        border: 2px solid palevioletred;
        background-color:${props => props.theme.colors.darkGrey};
    }

`;

const HeaderNav = () => {


    return (
        <LeftNav>
            <img src={logo} alt="Logo" />
            <ul>
                <li><Link to="/home"><button value="Home">Home</button></Link></li>
                <li><Link to="/menu"><button value="Menu">Menu</button></Link></li>
                <li><Link to="/cart"><button value="Cart">Cart</button></Link></li>
            </ul>
        </LeftNav >
    )
}

export default HeaderNav;
